import axios from 'axios';
const config = require('dotenv').config();


class ApiService { 

    constructor() {
        this.URL = 'http://localhost:4500'
    }


    login = async( email, password ) => {
        console.log(config)
        const res = await axios.post(this.URL, {email, password})
        return res;
    }

}


export const apiService = new ApiService();
